import React from 'react';
import './App.css';

function App() {
  return (
    <div className="root-view">
      <div className="rm-toolbar">
        <div className="logo">ICloud미리 알림</div>
        <div className="gnb">김진범</div>
      </div>
      <MainView className="main-view"></MainView>
    </div>
  );
}

class MainView extends React.Component {
  constructor(props) {
    super(props);
    this.title = {
      name: ""
    }
  }

  handleClick(title) {
    alert(title);
  }

  render() {
    return (
      <div>
        <Sidebar className="sidebar" onClick={this.handleClick}></Sidebar>
        <RmList className="rm-list"></RmList>
      </div>
    );
  }
}

class Sidebar extends React.Component {
  render() {
    const rmList = Array.of(
      1,
      2,
      3
    );

    return (
        <ul>
          {rmList}
        </ul>
    );
  }
}

class RmList extends React.Component {
  render() {
    return(
      <div>
        <div className="rm-list-header">
          <div className="inline-editable-label" role="textbox">
            Default
          </div>
        </div>
        <div className="rm-list-body"></div>
        <div className="rm-list-footer">새로운 미리 알림</div>
      </div>
    );
  }
}

export default App;
